import React, { Component } from "react";
import "../styles/global.css";
import * as api from "../utils";

class NavBar extends Component {
  state = { topics: [], isLoading: true };

  componentDidMount = () => {
    this.fetchTopics();
  };

  render() {
    return <nav className="Nav"> Topics</nav>;
  }
}

export default NavBar;
